        static void TraceNaturalEarthTable(NaturalEarthData.DataSetType dataSet, string tableName)
        {
            if (NaturalEarthData.GetNaturalEarthTables(dataSet).Contains(tableName))
            {
                SpatialTrace.Enable();
                SpatialTrace.Indent(tableName);

                foreach (NaturalEarthRow neRow in NaturalEarthData.GetNaturalEarthTableRows(dataSet, tableName))
                {
                    SpatialTrace.TraceGeometry(neRow.Geometry, neRow.name, neRow.name);
                }

                SpatialTrace.Unindent();
            }
            else
            {
                SpatialTrace.Enable();
                SpatialTrace.TraceText("Table " + tableName + " does not exists.");
            }

        }

        static void TestWorld(bool useLabels = false, bool useIndents = false)
        {
            SpatialTrace.Enable();
            SpatialTrace.Clear();

            List<Country> v_countries = GetCountries();

            SpatialTrace.Enable();
            foreach (var countryByContinent in v_countries.GroupBy(p => p.Continent))
            {
                if (useIndents) SpatialTrace.Indent(countryByContinent.Key);

                foreach (var pays in countryByContinent)
                {
                    SpatialTrace.TraceGeometry(pays.Geometry, pays.Name, pays.Name);
                }

                if (useIndents) SpatialTrace.Unindent();
            }

            //SpatialTrace.ShowDialog();
        }


